import React,{Component} from 'react'
import Upload from './components/imageUpload'
import { Router, Route } from "react-router";


class App extends Component{


render(){
  return(
    <div>
    <Router>
    <Route path = '/' component ={Upload}>
    </Route>
    </Router>      
    </div>
  )
}


}

export default App;
